import React from 'react';
import PropTypes from 'prop-types';

const MobileCard = ({ mobile, onBookNow }) => {
    return (
        <div className="card shadow-sm" style={{ width: "50%", margin: "10px auto", minHeight: '10px' }}>
            <img
                src={mobile.image_url || "https://via.placeholder.com/200"}
                alt={mobile.name}
                className="card-img-top"
                style={{ height: '300px', objectFit: 'cover' }}
            />
            <div className="card-body">
                <h5 className="card-title">{mobile.name}</h5>
                <p className="card-text text-muted" style={{ fontSize: '18px' }}>
                    {mobile.details || "No details available."}
                </p>
                <p className="card-text font-weight-bold text-primary">
                    Price: ₹{mobile.price ? mobile.price.toFixed(2) : "N/A"}
                </p>
                <button
                    className="btn btn-success mt-3"
                    onClick={() => onBookNow(mobile)}
                >
                    Book Now
                </button>
            </div>
        </div>
    );
};

MobileCard.propTypes = {
    mobile: PropTypes.shape({
        id: PropTypes.number.isRequired,
        name: PropTypes.string.isRequired,
        image_url: PropTypes.string,
        details: PropTypes.string,
        price: PropTypes.number,
    }).isRequired,
    onBookNow: PropTypes.func.isRequired,
};

export default MobileCard;
